import react, { useState } from 'react';
import { CircularProgress } from '@material-ui/core';

export default function ConsultaEncomenda(props) {

  const [loading, setLoading] = useState(true);

  return(
    <>
      {loading ? 
        <CircularProgress/>
          :
        props.token
      }
    </>
  );
}
